import React from 'react';
import { View, Button, StyleSheet } from 'react-native';
import { useNavigation } from '@react-navigation/native';

const MainPage = () => {
  const navigation = useNavigation();

  // A helper function to navigate to the page
  const navigateToPage = (pageName) => {
    navigation.navigate(pageName);
  };

  return (
    <View style={styles.container}>
      <Button title="Glavni Izbornik" onPress={() => navigateToPage('GlavniIzbornik')} />
      <Button title="Login Page" onPress={() => navigateToPage('LoginPage')} />
      <Button title="Popis Bodova" onPress={() => navigateToPage('PopisBodova')} />
      <Button title="Popis Divljaci" onPress={() => navigateToPage('PopisDivljaci')} />
      <Button title="Popis Lova" onPress={() => navigateToPage('PopisLova')} />
      <Button title="Popis Lovaca" onPress={() => navigateToPage('PopisLovaca')} />
      <Button title="Popis Ostrijele" onPress={() => navigateToPage('PopisOstrijele')} />
      <Button title="Raspored Aktivnosti" onPress={() => navigateToPage('RasporedAktivnosti')} />
      <Button title="Unos Bodova" onPress={() => navigateToPage('UnosBodova')} />
      <Button title="Unos Divljaci" onPress={() => navigateToPage('UnosDivljaci')} />
      <Button title="Unos Lovca" onPress={() => navigateToPage('UnosLovca')} />
      <Button title="Unos Ostrijele" onPress={() => navigateToPage('UnosOstrijele')} />
      <Button title="Unos Rasporeda" onPress={() => navigateToPage('UnosRasporeda')} />
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  },
});

export default MainPage;
